// libera div entrada de dados
function dv_Entendi(){
    document.getElementById("dv-entrada-de-dados-geometria").style.display = "block";
    document.getElementById("dv-rodape").style.display = "block";
    document.getElementById("dv-explicacao-geometria").style.display = "none";


}

// escolhe se é viga dv-apoiada ou em balanco
function dv_Tipo(){

    apoio = document.getElementById("dv-apo").checked;
    balan = document.getElementById("dv-bal").checked;
    
    if(balan === true){

        document.getElementById("dv-entrada-balanco").style.display = "block";;
        document.getElementById("dv-entrada-biapoiada").style.display = "none";
        
    }
    if(apoio === true){

        document.getElementById("dv-entrada-biapoiada").style.display = "block";
        document.getElementById("dv-entrada-balanco").style.display = "none";

    }

}

// define se há mudança de altura ou não
function dv_EscolhaAltura(){

    // campos relacionado a mudança brusca
    if(document.getElementById("dv-sim").checked){
        document.getElementById("dv-altura-com-mudanca").style.display = "block";
        document.getElementById("dv-resultado-com-mudanca").style.display = "block";
        document.getElementById("dv-altura-sem-mudanca").style.display = "none";
        document.getElementById("dv-resultado-sem-mudanca").style.display = "none";


    }
    // campos relacionados a uma unica altura
    if(document.getElementById("dv-nao").checked){
        document.getElementById("dv-altura-com-mudanca").style.display = "none";
        document.getElementById("dv-resultado-com-mudanca").style.display = "none";
        document.getElementById("dv-altura-sem-mudanca").style.display = "block";
        document.getElementById("dv-resultado-sem-mudanca").style.display = "block";


    }

}

// verifica se os valores foram inseridos e salva na memoria da sessão o atual
function dv_VerificarGeo(){

    // tipo de viga
    apoio = document.getElementById("dv-apo").checked;
    balan = document.getElementById("dv-bal").checked;

    // comportamento da altura
    mudan = document.getElementById("dv-sim").checked;
    unica = document.getElementById("dv-nao").checked;

    // medidas altura, base e comprimento
    alt = document.getElementById("dv-alt").value;
    alt = Number(alt);
    altuti = document.getElementById("dv-alt-uti").value;
    altuti = Number(altuti);
    altcon = document.getElementById("dv-alt-con").value;
    altcon = Number(altcon);
    base = document.getElementById("dv-bas").value;
    base = Number(base);
    comp = document.getElementById("dv-com").value;
    comp = Number(comp);
    vao = document.getElementById("dv-vao").value;
    vao = Number(vao);

    // verifica de o tipo de viga foi informado
    if((apoio === false) && (balan === false)){
        alert("Tipo de viga não informado");
        tipo = "";
    }

    // verifica se o comprimento foi informado
    if(balan === true){
        if((comp === "") || (comp === 0)){
            alert("Valor do comprimento não informado");
        }
        tipo = "dv-balanço";
    }

    // verifica se o vao foi informado
    if(apoio == true){
        if((vao === "") || (vao === 0)){
            alert("Valor do vão não informado");
        }
        tipo = "dv-apoiada";
    }

    // verifica se o comportamento da altura foi informado
    if((mudan === false) && (unica === false)){
        alert("Comportamento da altura não informado");
        compor = "";
    }

    // verifica se as alturas foram informadas quando há mudança
    if(mudan === true){
        if((alt === "") || (alt === 0)){
            alert("Valor da altura original (h) não informado");
        }
        if((altuti === "") || (altuti === 0)){
            alert("Valor da altura útil (h1) não informado");
        }
        if(altuti/alt < 0.5){
            alert("Ultrapassa limite absoluto de entalhe");
        }
        compor = "dv-variavel";
    }

    // verifica se a altura foi informada quando não há mudança
    if(unica === true){
        if((altcon === "") || (altcon === 0)){
            alert("Valor da altura (h) não informado");
        }
        compor = "dv-constante";
    }

    // verifica o valor da base
    if(base === ""){
        alert("Valor da base não informado");
    }

    // verifica se a base é maior que 5cm
    if(base < 50){
        alert("Valor da base inferior ao valor mínimo de 5 cm")
    }

    // libera a área de contas
    if(base >= 50){
        if(balan === true){
            if(mudan === true){
                if(((alt != "") || (alt != 0)) && ((altuti != "") || (altuti != 0)) && ((comp != "") || (comp != 0)) && (altuti/alt >= 0.5)){
                    document.getElementById("dv-contas-geometria").style.display = "block";
                }
            }
            if(unica === true){
                if(((altcon != "") || (altcon != 0)) && ((comp != "") || (comp != 0))){
                    document.getElementById("dv-contas-geometria").style.display = "block";
                }
            }
        }
        if(apoio === true){
            if(mudan === true){
                if(((alt != "") || (alt != 0)) && ((altuti != "") || (altuti != 0)) && ((vao != "") || (vao != 0)) && (altuti/alt >= 0.5)){
                    document.getElementById("dv-contas-geometria").style.display = "block";
                }
            }
            if(unica === true){
                if(((altcon != "") || (altcon != 0)) && ((vao != "") || (vao != 0))){
                    document.getElementById("dv-contas-geometria").style.display = "block";
                }
            }
        }
    }

    // passando valores para metros
    alt = alt/1000;
    altuti = altuti/1000;
    altcon = altcon/1000;
    base = base/1000;

    // salvando os valores
    sessionStorage.setItem("dv-altura-original", alt);
    sessionStorage.setItem("dv-altura-util", altuti);
    sessionStorage.setItem("dv-altura-constante", altcon);
    sessionStorage.setItem("dv-base", base);
    sessionStorage.setItem("dv-comprimento-viga", comp);
    sessionStorage.setItem("dv-vao", vao);
    sessionStorage.setItem("dv-tipo-viga", tipo);
    sessionStorage.setItem("dv-comportamento-altura", compor);

}

// calcula a área
function dv_Area(){

    // obtem comportamento da altura
    compor = sessionStorage.getItem("dv-comportamento-altura");

    // obtem a base
    base = sessionStorage.getItem("dv-base");

    // se há mudança de altura
    if(compor === "dv-variavel"){
        
        alturauti = sessionStorage.getItem("dv-altura-util");
        areauti = alturauti*base;

        alturaori = sessionStorage.getItem("dv-altura-original");
        areaori = alturaori*base;

        // salvando valores em metros
        sessionStorage.setItem("dv-area-original", areaori);
        sessionStorage.setItem("dv-area-util", areauti)
        
        // retorno da área em mm^2
        areauti = areauti*Math.pow(10,6);
        areaori = areaori*Math.pow(10,6);

        // numero de casas decimais
        areauti = areauti.toFixed(4);
        areaori = areaori.toFixed(4);

        // unidade
        uni = "<sup>2</sup>";

        // verifica se a area é superior a 50cm^2
        if(areauti >= 5000){
            // retorna as respostas/
            document.getElementById("dv-are-uti").innerHTML = areauti;
            document.getElementById("dv-uni-uti").innerHTML = "mm" + uni;

            document.getElementById("dv-are-alt").innerHTML = areaori;
            document.getElementById("dv-uni-alt").innerHTML = "mm" + uni;

        }
        else{

            alert("Área inferior a área mínima de 50 cm²");

        }
       
        
    }

    // se não há mudança de altura
    if(compor === "dv-constante"){

        altura = sessionStorage.getItem("dv-altura-constante");

        area = altura*base;

        // salva as respostas em metros
        sessionStorage.setItem("dv-area-constante", area);

        // retorno da área em mm^2
        area = area*Math.pow(10,6);

        // numero de casas decimais
        area = area.toFixed(4);
        // unidade
        uni = "<sup>2</sup>";

        // verifica se a area é superior a 50cm^2
        if(area >= 5000){
            // retorna a resposta
            document.getElementById("dv-are-uni").innerHTML = area;
            document.getElementById("dv-uni-uni").innerHTML = "mm" + uni;

        }
        else{
            
            alert("Área inferior a área mínima de 50 cm²");

        }

    }

}

// calcula o momento de inercia
function dv_Inercia(){

    // obtem comportamento da altura
    compor = sessionStorage.getItem("dv-comportamento-altura");

    // obtem a base
    base = sessionStorage.getItem("dv-base");

    // se há mudança de altura
    if(compor === "dv-variavel"){
        
        alturauti = sessionStorage.getItem("dv-altura-util");

        // calculo da inercia
        inerciax = alturauti*alturauti*alturauti*base/12;
        inerciay = alturauti*base*base*base/12;

        // salva em metros
        sessionStorage.setItem("dv-inercia-x", inerciax);
        sessionStorage.setItem("dv-inercia-y", inerciay);  

        // retorno da inercia em mm^4
        inerciax = inerciax*Math.pow(10,12);
        inerciay = inerciay*Math.pow(10,12);

        // numero de casas decimais
        inerciax = inerciax.toFixed(4);
        inerciay = inerciay.toFixed(4);

        // unidade
        uni = "<sup>4</sup>";

        // retorna as respostas/
        document.getElementById("dv-ine-x").innerHTML = inerciax;
        document.getElementById("dv-uni-ine-x").innerHTML = "mm" + uni;
    
        document.getElementById("dv-ine-y").innerHTML = inerciay;
        document.getElementById("dv-uni-ine-y").innerHTML = "mm" + uni;  
        
    }

    // se não há mudança de altura
    if(compor === "dv-constante"){

        altura = sessionStorage.getItem("dv-altura-constante");

        // calculo da inercia
        inerciax = altura*altura*altura*base/12;
        inerciay = altura*base*base*base/12;

        // salva em metros
        sessionStorage.setItem("dv-inercia-x", inerciax);
        sessionStorage.setItem("dv-inercia-y", inerciay);  

        // retorno da área em mm^2
        inerciax = inerciax*Math.pow(10,12);
        inerciay = inerciay*Math.pow(10,12);

        // numero de casas decimais
        inerciax = inerciax.toFixed(4);
        inerciay = inerciay.toFixed(4);
        // unidade
        uni = "<sup>4</sup>";

        // retorna a resposta
        document.getElementById("dv-ine-x").innerHTML = inerciax;
        document.getElementById("dv-uni-ine-x").innerHTML = "mm" + uni;
        
        document.getElementById("dv-ine-y").innerHTML = inerciay;
        document.getElementById("dv-uni-ine-y").innerHTML = "mm" + uni; 

    }    

}

// calcula o modulo da resistencia geometrica
function dv_ResistenciaGeometrica(){

    // obtem comportamento da altura
    compor = sessionStorage.getItem("dv-comportamento-altura");

    // obtem a base
    base = sessionStorage.getItem("dv-base");

    // se há mudança de altura
    if(compor === "dv-variavel"){
        
        alturauti = sessionStorage.getItem("dv-altura-util");

        // calculo da resistencia geometrica
        resisx = alturauti*alturauti*base/6;
        resisy = alturauti*base*base/6;

        // salva em metros
        sessionStorage.setItem("dv-resistencia-geo-x", resisx);
        sessionStorage.setItem("dv-resistencia-geo-y", resisy);  

        // retorno da inercia em mm^4
        resisx = resisx*Math.pow(10,9);
        resisy = resisy*Math.pow(10,9);

        // numero de casas decimais
        resisx = resisx.toFixed(4);
        resisy = resisy.toFixed(4);

        // unidade
        uni = "<sup>3</sup>";

        // retorna as respostas
        document.getElementById("dv-res-geo-x").innerHTML = resisx;
        document.getElementById("dv-uni-res-geo-x").innerHTML = "mm" + uni;

        
    
        document.getElementById("dv-res-geo-y").innerHTML = resisy;
        document.getElementById("dv-uni-res-geo-y").innerHTML = "mm" + uni;  
        
    }

    // se não há mudança de altura
    if(compor === "dv-constante"){

        altura = sessionStorage.getItem("dv-altura-constante");

        // calculo da resistencia geometrica
        resisx = altura*altura*base/6;
        resisy = altura*base*base/6;

        // salva em metros
        sessionStorage.setItem("dv-resistencia-geo-x", resisx);
        sessionStorage.setItem("dv-resistencia-geo-y", resisy); 

        // retorno da inercia em mm^4
        resisx = resisx*Math.pow(10,9);
        resisy = resisy*Math.pow(10,9);

        // numero de casas decimais
        resisx = resisx.toFixed(4);
        resisy = resisy.toFixed(4);

        // unidade
        uni = "<sup>3</sup>";

        // retorna as respostas/
        document.getElementById("dv-res-geo-x").innerHTML = resisx;
        document.getElementById("dv-uni-res-geo-x").innerHTML = "mm" + uni;
    
        document.getElementById("dv-res-geo-y").innerHTML = resisy;
        document.getElementById("dv-uni-res-geo-y").innerHTML = "mm" + uni;  
        
    }    

}

